import React, { useState, useEffect } from "react";
import { useParams } from "react-router-dom";
// import LandPadInfo from "./LandPadInfo";
import axios from "axios";
const SingleLandpad = () => {
  const [singlePad, setSinglePad] = useState([]);
  const { id } = useParams();
  console.log(id);
  //   const fetchData = () => {

  //   };
  useEffect(() => {
    axios.get(`https://api.spacexdata.com/v4/landpads/${id}`).then((res) => {
      console.log(res.data);
      setSinglePad(res.data);
    });
  }, [id]);
  return (
    <>
      {/* // <div className="container my"> */}
      <div
        className="container text-light text-start my-5"
        style={{ marginTop: "90px" }}
      >
        <div className="my-5 col-sm-6" style={{ marginTop: "110px" }}>
          <img
            src={singlePad.images.large}
            // className="img-fluid"
            alt="..."
            style={{ height: "400px", marginTop: "90px",float:"right" }}
          />
        </div>
        <h1>
          <small className="text-light">LandPads Deatil</small>
        </h1>
        <h4 class>
          <small className="text-light text-center">
            {singlePad.name} ,{singlePad.full_name}
          </small>
        </h4>
        <div className="row">
          <div className="col-sm-6">
            <p>Type : {singlePad.type} </p>
            <p>locality : {singlePad.locality}kg</p>
            <p
              className={
                singlePad.status === "active" ? "text-success" : "text-danger"
              }
            >
              {singlePad.status}
            </p>

            <a
              href={singlePad.wikipedia}
              className="btn btn-outline-light btn-md"
            >
              wikipedia
            </a>
          </div>
          <div className="col-sm-6">
            <p>region : {singlePad.region}</p>
            <p> landing attempts : {singlePad.landing_attempts}</p>
            <p> success : {singlePad.landing_successes}</p>
            <div>
              <h6>Other Deatil:</h6>
              <p>latitude : {singlePad.latitude}</p>
              <p>longitude : {singlePad.longitude}</p>
            </div>
          </div>
        </div>
        <div>
          <p calssName="h7 text-start">{singlePad.details}</p>
        </div>
      </div>
      <div className="row">
        <div className="col-sm-6">
          <p1>
            Lorem ipsum dolor sit amet consectetur adipisicing elit. Autem iusto
            nam possimus, odio soluta tenetur voluptas fugit, impedit ipsa ut,
            delectus est. Commodi laudantium eius, asperiores dolor ratione quo
            sit.
          </p1>
        </div>
      </div>
      {/* // </div> */}
    </>
  );
};

export default SingleLandpad;
